I DOHC 6-Speed Automatic with Sportmatic gray Cloth.At Tempe CJDR and Kia, we are committed to providing our customers with SAFE and RELIABLE vehicles at the RIGHT PRICE! All pre-owned vehicles are subject to an extensive 110 point inspection, and ALL reconditioning costs are already included in the price of the vehicle. *Tempe $1,000 Finance Bonus Cash discount only available for standard prime lender conventional financing arranged through Tempe Dodge OAC. We reserve the right to determine customer eligibility for the $1,000 Tempe Finance Bonus Cash discount.Awards:* 2015 IIHS Top Safety Pick * 2015 KBB.com 10 Best UberX CandidatesReviews:* Looking for a practical family sedan that doesn't look like a practical family sedan? You have a few cars from which to choose, but none as feature packed as the 2015 Kia Optima. Source: KBB.com* Lots of standard and optional features for the money; handsome cabin with easy-to-use controls and comfortable front seats; top crash scores; lengthy warranty. Source: Edmunds* With world-class engineering, outstanding performance and advanced safety systems, the 2015 Kia Optima gives you good reason to be passionate about driving a midsize sedan. It combines bold exterior styling, performance and a spacious, luxurious cabin. With the Optima, exhilaration is standard. The key to its exciting performance are the two available engines: the 2.4L Gasoline Direct Injection with an EPA rated 24 city/35 hwy mpg or the turbocharged 2.0L GDI I4 engine that delivers 274 horsepower and fuel efficiency of 22 city/34 hwy mpg. The Optima also has a standard 6-speed Sportmatic transmission for an engaging driving experience. The Optima Hybrid features a 2.4L Atkinson cycle 4-cyl. engine giving an amazing 35 city/40 hwy mpg. Spacious and comfortable seating can accommodate five adults and includes a driver's seat with power lumbar and available leather seat trim. Rear seats have a 60/40 split-folding design for added versatility. Optima EX/EX Turbo and SX Premium Packages include front and rear heated seats and heated front seatbacks for cold-weather comfort. The Optima is designed to make every drive a pleasure. The available Premium Touring Package includes features like the innovative UVO infotainment system which lets you use your compatible cell phone to make hands-free calls, receive and respond to text messages, listen to streaming audio, enjoy your personal music, and play your favorite song, artist or genre of music all by giving a single voice command, premium Infinity sound system for exceptional audio entertainment, and a panoramic sunroof. The available Technology Package includes a voice command navigation system, giving you access to detailed highway conditions from SiriusXM Traffic. Source: The Manufacturer Summary", :title=>"2015 Kia Optima", :external_image=>"https://cdn-w.v12soft.com/photos/vQN4A0p/12681776/001_080420202227138cf9_800600.jpg", :external_imagefront=>"https://cdn-w.v12soft.com/photos/vQN4A0p/12681776/002_080420202227147961_800600.jpg", :external_imageback=>"https://cdn-w.v12soft.com/photos/vQN4A0p/12681776/003_08042020222714f9e3_800600.jpg", :external_imageleft=>"https://cdn-w.v12soft.com/photos/vQN4A0p/12681776/004_0804202022271534d2_800600.jpg", :external_imageright=>"https://cdn-w.v12soft.com/photos/vQN4A0p/12681776/005_0804202022271514251_800600.jpg", :external_frontinterior=>"https://cdn-w.v12soft.com/photos/vQN4A0p/12681776/006_080420202227166806_800600.jpg", :external_rearinterior=>"https://cdn-w.v12soft.com/photos/vQN4A0p/12681776/007_08042020222716858a_800600.jpg", :external_url=>true, :approved=>true})
