d prime lender conventional financing arranged through Tempe Dodge OAC. We reserve the right to determine customer eligibility for the $1,000 Tempe Finance Bonus Cash discount.Awards:* 2014 IIHS Top Safety PickReviews:* If you are on the prowl for an American-made 5-passenger SUV with high-style and genuine off-road chops, the 2014 Jeep Grand Cherokee is a solid choice. Thanks to an alluring new array of in-vehicle electronics, the Grand Cherokee is also one of the most technologically advanced entrants in the category. Source: KBB.com* Strong and fuel-efficient engine lineup, including a new diesel V6; upscale interior; plenty of luxury and technology-oriented features; irrefutable off-road ability; outlandish SRT model. Source: Edmunds* Redesigned for 2014 the Jeep Grand Cherokee is already making praises and setting standards for performance, luxury, Best-in-Class Highway Fuel Economy, and attention to detail. A confident and elegant exterior design exudes strength from every angle. For 2014, every Grand Cherokee from Laredo to Summit features premium styling treatments including new, modern front grille and fascia treatments, daytime running headlamps, projector fog lamps and capless fuel fillers. The rear of the Grand Cherokee offers new, larger taillamps with signature LED lighting, a larger rear aerodynamic spoiler and a re-sculpted tailgate for greater rear visibility, and a new capless fuel fill and power liftgate for more simplicity and convenience. Grand Cherokee comes standard with seating for up to five passengers. The new, available premium-quality Natura Plus leather is soft and supple and has outstanding breathability that makes the leather more comfortable in both hot and cold weather. Adding to the luxury and comfort are heated/ventilated front seats and heated rear seats. The rear cargo area in the 2014 Grand Cherokee lets you configure up to 68.3 cubic feet of storage when the rear seat is folded down. Choose from 3 different engines including the new 3.0L EcoDiesel V6 which can attain up to 30hwy mpg, drive up to 730 miles on one tank and tow up to 7,400 pounds. The 3.6L V6 engine features new eight-speed automatic transmission, with paddle-shift steering wheel controls and the new Eco Mode improves fuel efficiency by 9% and allows you to tow up to 6,200 pounds. Finally, the 5.7L V8 engine with Fuel Saving Technology boasts 360hp and 390lb-ft of torque and provides a Best-in-Class 7,400-pound towing capacity. Inside the newly updated Uconnect System features a massive 8.4-inch touchscreen, Full-Feature Navigation, SiriusXM Travel Link/SiriusXM Traffic and HD Radio. Enjoy music on 1 of the 3 available speaker systems including the top of the line Harman Kardon 19 speaker system. Source: The Manufacturer Summary", :title=>"2014 Jeep Grand Cherokee", :external_image=>"https://cdn-w.v12soft.com/photos/vQN4A0p/12809804/001_080420202229355327_800600.jpg", :external_imagefront=>"https://cdn-w.v12soft.com/photos/vQN4A0p/12809804/002_0804202022293616579_800600.jpg", :external_imageback=>"https://cdn-w.v12soft.com/photos/vQN4A0p/12809804/003_0804202022293743a6_800600.jpg", :external_imageleft=>"https://cdn-w.v12soft.com/photos/vQN4A0p/12809804/004_08042020222938707b_800600.jpg", :external_imageright=>"https://cdn-w.v12soft.com/photos/vQN4A0p/12809804/005_08042020222938cb51_800600.jpg", :external_frontinterior=>"https://cdn-w.v12soft.com/photos/vQN4A0p/12809804/006_08042020222939ec0c_800600.jpg", :external_rearinterior=>"https://cdn-w.v12soft.com/photos/vQN4A0p/12809804/007_08042020222939a36a_800600.jpg", :external_url=>true, :approved=>true})
