iscount.Awards:* 2015 KBB.com 10 Coolest New Cars Under $18,000 * 2015 KBB.com Best Buy Awards Finalist * 2015 KBB.com 15 Best Family CarsReviews:* Loads of available features; attractive cabin with user-friendly controls and ample passenger space; long warranty; excellent crash test scores. Source: Edmunds* Whether you desire value, practicality, stylish looks or surprising technology and amenities in your economy hatchback, the 2015 Soul checks all the boxes. The new plug-in Kia Soul EV, meanwhile, offers all that in an electric car with an EPA-estimated range of 93 miles. Source: KBB.com* Totally transformed, the Kia Soul is more fun to drive, has more advanced technology, and more surprises. It looks different because it is different. With its unique styling inside and out and impressive features it's a new way to roll. Think of the Soul as your personal canvas. It's ready for custom touches. Unique colors inside and out for you to choose from. Plenty of optional accessories, like aluminum sill plates for the doors, all-weather floormats and bumper applique. For the finishing touch, a sunshade with the name Soul on it. Soul ! models have distinctive front LED accent lights and LED taillights to stand apart from the rest. Enjoy the strong performance of Soul's 130-hp 1.6L engine or Soul + and ! models' 164-hp 2.0L engine and 6-speed automatic transmission. Manual transmission is also available on Soul and Soul +. An available Eco Package on Soul+ includes Idle Stop & Go. It automatically turns off the engine when you come to a complete stop and then seamlessly restarts the engine when you release the brake pedal. Inside you will experience tons of standard features including 60/40 split-folding rear seats and Bluetooth. Available features include sunroof, push-button start with smart key, pulsating speaker lights, heated front seats, power-folding mirrors, voice-command navigation system, automatic climate control, rear-camera display, USB/aux for your MP3s, an accessory cable that lets you control your iPod, and UVO infotainment system which lets you use your compatible cell phone to make hands-free calls, receive and respond to text messages, listen to streaming audio, enjoy your personal music, and play your favorite song, artist or genre of music all by giving a single voice command. Source: The Manufacturer Summary", :title=>"2015 Kia Soul", :external_image=>"https://cdn-w.v12soft.com/photos/vQN4A0p/12955771/001_0804202022534314e0f_800600.jpg", :external_imagefront=>"https://cdn-w.v12soft.com/photos/vQN4A0p/12955771/002_080420202253444104_800600.jpg", :external_imageback=>"https://cdn-w.v12soft.com/photos/vQN4A0p/12955771/003_08042020225345d5df_800600.jpg", :external_imageleft=>"https://cdn-w.v12soft.com/photos/vQN4A0p/12955771/004_08042020225345169c0_800600.jpg", :external_url=>true, :approved=>true})
